<!DOCTYPE html>
<html lang="ar" dir="rtl">
<head>
    <meta charset="UTF-8">
    <title>تصويت المجوهرات</title>
    <style>
        body {
            font-family: Arial, Helvetica, sans-serif;
            background-color: #f9f9f9;
            color: #333;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 20px;
        }
        #login, #voting, #thankYou {
            max-width: 600px;
            width: 100%;
            text-align: center;
            margin-top: 50px;
        }
        input[type="text"] {
            width: 80%;
            padding: 10px;
            margin: 10px 0;
            font-size: 16px;
        }
        button {
            padding: 10px 20px;
            font-size: 16px;
            margin: 10px;
            cursor: pointer;
            border: none;
            border-radius: 4px;
        }
        #skipButton {
            background-color: #e74c3c;
            color: #fff;
        }
        #chooseButton {
            background-color: #2ecc71;
            color: #fff;
        }
        #imageContainer {
            margin-top: 20px;
        }
        #productImage {
            max-width: 100%;
            max-height: 400px;
            border: 1px solid #ccc;
            border-radius: 8px;
        }
    </style>
</head>
<body>
<div id="login">
    <h2>مرحبا! الرجاء إدخال اسمك لبدء التصويت</h2>
    <input id="username" type="text" placeholder="اسمك">
    <button onclick="startVoting()">ابدئي التصويت</button>
</div>

<div id="voting" style="display: none;">
    <h3 id="userLabel"></h3>
    <div id="imageContainer">
        <img id="productImage" src="" alt="منتج">
    </div>
    <div id="controls">
        <button id="skipButton" onclick="vote(false)">تجاهل</button>
        <button id="chooseButton" onclick="vote(true)">اختيار</button>
    </div>
    <p id="progress"></p>
</div>

<div id="thankYou" style="display: none;">
    <h3>شكراً لمشاركتك في التصويت!</h3>
    <p id="summary"></p>
</div>

let currentIndex = 0;
let liked = [];
let user = "";

function startVoting() {
    const usernameInput = document.getElementById('username');
    const username = usernameInput.value.trim();
    if (!username) {
        alert('يرجى إدخال اسمك للبدء');
        return;
    }
    user = username;
    document.getElementById('userLabel').innerText = 'مرحباً، ' + user;
    document.getElementById('login').style.display = 'none';
    document.getElementById('voting').style.display = '';
    currentIndex = 0;
    liked = [];
    showImage();
}

function showImage() {
    if (currentIndex >= images.length) {
        finishVoting();
        return;
    }
    document.getElementById('productImage').src = images[currentIndex];
    document.getElementById('progress').innerText = 'الصورة ' + (currentIndex + 1) + ' من ' + images.length;
}

function vote(choice) {
    if (choice) {
        liked.push(images[currentIndex]);
    }
    currentIndex++;
    showImage();
}

function finishVoting() {
    document.getElementById('voting').style.display = 'none';
    document.getElementById('thankYou').style.display = '';
    const summaryText = liked.length > 0
        ? 'قمتِ باختيار ' + liked.length + ' من أصل ' + images.length + ' منتج.'
        : 'لم تختاري أي منتج.';
    document.getElementById('summary').innerText = summaryText;
    // حفظ النتيجة في المتصفح لكل مستخدم
    const record = { user: user, liked: liked, date: new Date().toISOString() };
    let votes = [];
    try {
        votes = JSON.parse(localStorage.getItem('votes') || '[]');
    } catch (e) {
        votes = [];
    }
    votes.push(record);
    localStorage.setItem('votes', JSON.stringify(votes));
}
</script>
